package com.example.demo.demoproject;

import java.io.BufferedOutputStream;
import java.io.File;
import java.io.FileOutputStream;
import java.io.IOException;
import java.util.Base64;
import java.util.UUID;

public class base642 {

    /**
     * 测试base64转图片，并存储到本地
     * @param base64 base64字符串
     *
     */
    public static void saveImg(String base64) throws IOException {
        byte[] bs = new byte[2048];
        bs = Base64.getMimeDecoder().decode(base64);
        BufferedOutputStream bos = null;
        FileOutputStream fos = null;
        File file = null;
        file = new File("D:\\"+ UUID.randomUUID()+".jpg");
        try {
            fos = new FileOutputStream(file);
            bos = new BufferedOutputStream(fos);
            bos.write(bs);
            System.out.println("已保存");
        } catch (Exception e) {
            e.printStackTrace();
        } finally {
            if (bos != null) {
                try {
                    bos.close();
                } catch (IOException e) {
                    e.printStackTrace();
                }
            }
            if (fos != null) {
                try {
                    fos.close();
                } catch (IOException e) {
                    e.printStackTrace();
                }
            }
        }
    }

    public static void main(String[] args) throws IOException {
//        String base64Img = "data:image/png;base64,";
//        base642.saveImg(base64Img);
//
    }
}
